realtype gen_cost(realtype* y, realtype* campos)
{
	realtype cost;
	realtype* r = y + INDR;
	realtype* q = y + INDQ;
	realtype* v = y + INDV;
	realtype* omega = y + INDW;
	realtype* u = y + INDU;

	realtype alpha = ALPHA;
	realtype beta = BETA;
	realtype Gamma = GAMMA;
	realtype kappa = KAPPA;

	cost = alpha * (pow(u[0], 0.2e1) + pow(u[1], 0.2e1) + pow(u[2], 0.2e1) + pow(u[3], 0.2e1)) / 0.2e1 + beta * (pow(r[0] - campos[0], 0.2e1) + pow(r[1] - campos[1], 0.2e1) + pow(r[2] - campos[2], 0.2e1)) / 0.2e1 + Gamma * (pow(q[0], 0.2e1) + pow(q[1], 0.2e1) + pow(q[2], 0.2e1) + pow(q[3], 0.2e1)) / 0.2e1 + kappa * (pow(omega[0], 0.2e1) + pow(omega[1], 0.2e1) + pow(omega[2], 0.2e1) + pow(v[0], 0.2e1) + pow(v[1], 0.2e1) + pow(v[2], 0.2e1)) / 0.2e1;


	return cost;
}

